one thing i like to advise my couples before the booking process is “your venue sets the tone for you whole day. how do you want the the day to feel?”
——
venue choice is crucial & defines your whole wedding & aesthetic. venues I’m gravitating more towards are ones that have a lot of detail, good light, have a vintage feel to them like @mccunemansion does.
——
these are some of my favorite work yet. i shot a mix of digital & film, used my flash more than not using it, edited to how I felt the image should be instead of being consistent, these are all things I love about the direction my work is headed.
——
shooting this amazing @shop_cinq gown from @frankiejanecouturebridal was truly an honor. thank you to everyone who made this shoot possible. hope you can pull some inspiration from these & brides if your mood board looks like these, I’m your guy. 2024 is filling up fast!
